<script>
	import {
		getLotteryData,
		startLottery,
		receiveLottery,
	} from '@/api/lottery.js';
	import {
		HTTP_REQUEST_URL
	} from '@/config/app';
	import noticeBar from '../components/noticeBar.vue';
	import lotteryAleart from '../../components/lotteryAleart/index.vue';
	export default {
		components: {
			noticeBar,
			lotteryAleart,
		},
		data() {
			return {
				imgHost: HTTP_REQUEST_URL,
				wr7s: false,
				userList: [],
				myList: [],
				rulesShow: false,
				rotateAngle: 0,
				angleList: [],
				prizeList: [],
				winingIndex: 0,
				lottery_num: 0,
				id: 0,
				type: '1',
				aleartStatus: false,
				addressModel: false,
				H5ShareBox: false,
				aleartType: 0,
				alData: {},
				htmlData: '',
				factor: 0,
			}
		},
		computed: {},
		onLoad() {
			for (let i = 0; i < 8; i++) {
				const angle = -(i * 45 + (45 / 2));
				this.angleList.push(angle)
			}
			this.getLotteryData(this.type)
		},
		methods: {
			getLotteryData(type) {
				uni.showLoading({
					title: '获取抽奖信息'
				});
				getLotteryData(type).then(res => {
					uni.hideLoading();
					console.log(res)
					let lottery = res.data.lottery;
					this.id = res.data.lottery.id;
					this.prizeList = lottery.prize;
					this.lottery_num = res.data.lottery_num;
					this.userList = res.data.all_record;
					this.myList = res.data.user_record;
					this.htmlData = res.data.lottery.content;
					this.factor = res.data.lottery.factor;
				}).catch(err => {
					uni.hideLoading();
					// this.lotteryShow = false
					// this.loading = true
					this.$util.Tips({
						title: err
					});
				})
			},
			getWiningIndex() {
				let that = this
				startLottery({
					id: this.id,
					type: this.type
				}).then(res => {
					// if (res.data.code === 'subscribe') {
					// 	that.$set(that, 'followCode', true);
					// 	this.codeSrc = res.data.url
					// 	return;
					// }
					this.alData = res.data;
					let winingIndex = this.prizeList.findIndex(item => {
						return item.id == this.alData.id;
					});
					this.winingIndex = winingIndex;
					this.rotating();
				}).catch(err => {
					this.$util.Tips({
						title: err
					});
				})
			},
			random(min, max) {
				return parseInt(Math.random() * (max - min + 1) + min)
			},
			rotating() {
				const config = {
					duration: 5000,
					circle: 8,
					mode: "ease-in-out"
				}
				// 计算角度
				const angle =
					// 初始角度
					this.rotateAngle +
					// 多旋转的圈数
					config.circle * 360 +
					// 奖项的角度
					this.angleList[this.winingIndex] -
					(this.rotateAngle % 360);
				this.rotateAngle = angle;
				// 旋转结束后
				setTimeout(() => {
					// isRotating = false;
					this.luck_draw_finish();
				}, config.duration + 500);
			},
			// 抽奖完成
			luck_draw_finish(param) {
				this.aleartType = 2
				this.aleartStatus = true
			},
			closeLottery(status) {
				this.aleartStatus = false;
				this.getLotteryData(this.type);
			},
			moveHandle() {}
		},
	}
</script>

